import manageJss from "@microsoft/fast-jss-manager-react";
import { FlipperStyles } from "@microsoft/fast-components-styles-msft";
import MSFTFlipper, { FlipperDirection, } from "./flipper";
import flipperSchema from "./flipper.schema";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const Flipper = manageJss(FlipperStyles)(MSFTFlipper);
export { Flipper, FlipperDirection, flipperSchema, };
